    name: "Stranger things"
},

{
    imgsrc:`${pus}`,
    link:"https://www.primevideo.com/detail/0QH32UG7NRSFRGZT78NFD6KED7/",
    name:"Pushpa"
},
{
    imgsrc:`${pus}`,
    link:"https://www.primevideo.com/detail/0QH32UG7NRSFRGZT78NFD6KED7/",
    name:"Pushpa"
}
]
export default Arr;
